import React, {useState} from 'react'
import "./agents.css"

function AgentsCard({agent}) {
  const [toggle, setToggle]= useState(true)

  function toggleSwitch (){
    setToggle(!toggle)
  }
  return (
    <div className = "card-items">
        <div className="card">
            <img
                src = {agent.image}
                alt = {agent.name}
                classNmae = "card-image"
            />
            <div className="card_content">
                <div className="card_title">{agent.name}</div>
                <div className="card_contact" onClick= {toggleSwitch} > 
                {toggle ? (<p>{agent.email} </p>) : (<p> {agent.about}</p>)}                    
                   {/* {agent.mobile}  
                   {agent.email}
                   {agent.office} */}
                </div>
            </div>
        </div>
    </div>
  )
}

export default AgentsCard
